INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ねぇねぇ、騎士クン\n手伝ってあげようよ～", 2, 1, 0, 1001, "春咲 ひより", 0, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1.4, 1, 1, 0, 0, "お！\nあそこに困ってそうな人発見！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("わ、わたし、\nなに言ってるんだろ\nあはは…", 2, 1, 0, 1002, "草野 優衣", 0, 0, "みんなみたいに\nわたしも強くならなきゃ", 1.4, 1, 1, 0, 0, "大切な人を\n守れるようになりたい…って");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("少しは磨かれると思いますよ。", 2, 1, 0, 1003, "士条 怜", 0, 0, "フェンシングを始めてみては？", 1.4, 1, 1, 0, 0, "キミに必要な集中力と感性が");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("みそぎはねぇ、\nかくれんぼやりたい！", 2, 1, 0, 1004, "穂高 みそぎ", 0, 0, "ねぇ、にいちゃん！", 1.5, 1, 1, 0, 0, "今日はなにして遊ぶ？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("私といっしょに…\nいかない？", 2, 1, 0, 1006, "風宮 あかり", 0, 0, "風宮あかりです", 1.4, 1, 1, 0, 0, "ねぇ…");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("食べ物の恨みは怖いのー", 2, 1, 0, 1007, "出雲 宮子", 0, 0, "出雲宮子なのー", 1.5, 1, 1, 0, 0, "プリンたべたいのー");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("いいよ。\n見られることは運命さ…", 2, 1, 0, 1008, "虹村 雪", 0, 0, "ボクは虹村雪。", 1.4, 1, 1, 0, 0, "キミもボクの美貌に\n吸い寄せられたんだね。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("人呼んで「疾風の冥姫」!!", 2, 1, 0, 1009, "柊杏奈", 0, 0, "フッ…聞いて後悔するがいい！", 1.4, 1, 1, 0, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ほんまおおきにやわ～♪", 2, 1, 0, 1010, "姫宮 真歩", 0, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 1.5, 1, 1, 0, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ここで会ったが\n100年目～！", 2, 1, 0, 1011, "衣之咲 璃乃", 0, 0, "衣之咲璃乃です！", 1.4, 1, 1, 0, 0, "生き別れたお兄ちゃんを探して\n三千世界！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("…って、お願い！\n誰にも言わないでおいて～！", 2, 1, 0, 1012, "柏崎 初音", 0, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1.4, 1, 1, 0, 0, "ち、超能力って…\n何のことかな～？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ヒデサイまぢ\nGF（グッドフィーリング）～♪", 2, 1, 0, 1016, "美波 鈴奈", 0, 0, "ちょす！\n美波鈴奈だよ～♪", 1.4, 1, 1, 0, 0, "一応カリスマ読モJKやってまっす！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("でも、沖縄もとってもいいとこさー", 2, 1, 0, 1017, "喜屋武 香織", 0, 0, "はいたーい。\n喜屋武香織さー。", 1.4, 1, 1, 0, 0, "東京は遊園地みたいなところさー");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("イオちゃんって呼んでね。", 2, 1, 0, 1018, "支倉 伊緒", 0, 0, "支倉伊緒です。", 1.4, 1, 1, 0, 0, "先生って呼ばれるのは\nくすぐったいから");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ミミをおいてかないでぇ～", 2, 1, 0, 1020, "茜 ミミ", 0, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1.5, 1, 1, 0, 0, "あ！/\お兄ちゃ～ん\nまってよ～");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ふぇぇぇぇぇん……", 2, 1, 0, 1021, "栗林 くるみ", 0, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 1.5, 1, 1, 0, 0, "あの……\nふぇ……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("なんてありがとうございます！", 2, 1, 0, 1022, "風宮 より", 0, 0, "風宮よりです。\nあああああ！", 1.4, 1, 1, 0, 0, "こんな私に貴重な時間を\n割いていただき、");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("私こっち行きたいー\nね、早く早くー", 2, 1, 0, 1023, "北条 綾音", 0, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1.5, 1, 1, 0, 0, "おにいちゃんどこいくの？\nえ？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("これて何か違う…\nあああすみません！", 2, 1, 0, 1025, "天野 すずめ", 0, 0, "わっ…わっ…私、\n天野すずめといいます！", 1.4, 1, 1, 0, 0, "ふ、不束者ですが\nどうぞ末永く…って、");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("離しませんわ………\n絶対に…!!", 2, 1, 0, 1027, "倉石 恵理子", 0, 0, "……クスクス…私は\n…倉石恵理子……", 1.4, 1, 1, 0, 0, "あなたは…運命の……\n伴侶……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("…そうでしょ？？", 2, 1, 0, 1028, "佐々木 咲恋", 0, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1.4, 1, 1, 0, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("あはは、\n私もまだまだだなぁ～", 2, 1, 0, 1029, "桜井 望", 0, 0, "桜井望だよ！\nよろしくねっ", 1.4, 1, 1, 0, 0, "ぇっと…\nキミ、私のこと知らないの?!");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ショーグン、\nワタシと一緒に天下統一デース！", 2, 1, 0, 1030, "ニノン・ジュベール", 0, 0, "デケデケデンっ！", 1.4, 1, 1, 0, 0, "初めまして、\n私はニノン・ジュベール申すデス！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("おかしいですね……", 2, 1, 0, 1031, "上喜 しのぶ", 0, 0, "上喜しのぶです。\n手元のドクロが父です。", 1.4, 1, 1, 0, 0, "でもって私の隣にいるのが……\nえ、見えない？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("そう、\nオラのボケに突っ込める相方が…！", 2, 1, 0, 1033, "野戸まひる", 0, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 1.5, 1, 1, 0, 0, "けんども\nそれには足りないモンが…");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ちょ\nちょっと一杯飲んできます…！", 2, 1, 0, 1034, "綾瀬 ゆかり", 0, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1.4, 1, 1, 0, 0, "ちょっと緊張しちゃって…");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("これ以上お話しすることは…\nないです！", 2, 1, 0, 1036, "氷川 鏡華", 0, 0, "氷川鏡華…です", 1.5, 1, 1, 0, 0, "知らない人とは話しちゃいけないので");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 2, 1, 0, 1038, "柏崎 栞", 0, 0, "柏崎…栞です。", 1.4, 1, 1, 0, 0, "……あ、アラーム。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("野に咲く花が、\n唯一の話相手です。", 2, 1, 0, 1040, "双葉 碧", 0, 0, "ふ、双葉碧です。", 1.4, 1, 1, 0, 0, "私、一人も友達がいなくて……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("そう思っています。", 2, 1, 0, 1042, "三角 千歌", 0, 0, "三角千歌です。", 1.4, 1, 1, 0, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("う、疑ってすまなかったな…", 2, 1, 0, 1043, "安芸 真琴", 0, 0, "安芸真琴だ。", 1.4, 1, 1, 0, 0, "あぁ？\nお前のそいつの仲間か？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 2, 1, 0, 1044, "イリヤ・オーンスタイン", 0, 0, "わらわこそは夜を総べる者！", 1.4, 1, 1, 0, 0, "生けとし生ける全ての者よ！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ｌク、クウカに何かご用ですか!?", 2, 1, 0, 1045, "遠見 空花", 0, 0, "そこで騎士は妖精を乱暴に……", 1.4, 1, 1, 0, 0, "ぐふふふふ……はっ！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("う～ん…\n猫ってホントに最高にゃ～♪", 2, 1, 0, 1046, "宮坂たまき", 0, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1.4, 1, 1, 0, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("…と思ったら\nバイトの時間だ！\nまたあとでね！", 2, 1, 0, 1048, "大神 美冬", 0, 0, "大神美冬よ！", 1.4, 1, 1, 0, 0, "それでは早速クエストに…");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("お姉ちゃんがぜ～んぶ\nやってあげるからね！", 2, 1, 0, 1049, "星野静流", 0, 0, "星野静流だよ！", 1.4, 1, 1, 0, 0, "クエストもバトルも\n掃除も洗濯も");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 2, 1, 0, 1050, "玉泉美咲", 0, 0, "アタシは玉泉美咲。", 1.5, 1, 1, 0, 0, "見ての通りの\nセクシー美少女で");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("？？？？", 2, 1, 0, 1052, "リマ", 0, 0, "？？？", 1.4, 1, 1, 0, 0, "？？？？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("そ、そこまでいうなら\nもらってやる", 2, 1, 0, 1053, "モニカ・ヴァイスヴィント", 0, 0, "モニカ・ヴァイスヴィントだ。", 1.5, 1, 1, 0, 0, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("そ、そこまでいうなら\nもらってやる", 2, 1, 0, 1058, "ペコリーヌ", 0, 0, "モニカ・ヴァイスヴィントだ。", 1.5, 1, 1, 0, 0, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("そ、そこまでいうなら\nもらってやる", 2, 1, 0, 1059, "コッコロ", 0, 0, "モニカ・ヴァイスヴィントだ。", 1.5, 1, 1, 0, 0, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("そ、そこまでいうなら\nもらってやる", 2, 1, 0, 1060, "キャル", 0, 0, "モニカ・ヴァイスヴィントだ。", 1.5, 1, 1, 0, 0, "菓子でつろうなどと\n稚拙な策を……");
